import { Component } from 'react';

import logo from './logo.svg';
import './App.css';

class App extends Component {
  constructor() {
    super();

    this.state = {
      nfts: [
        {
          name: 'Jack',
        },
        {
          name: 'Frank',
        },
        {
          name: 'Andrew',
        },
      ],
    };
  }

  render() {
    return (
      <div className='App'>
        {this.state.nfts.map((nft)=>{<h1>{nft.name}</h1>})}
      </div>
    );
  }
}

export default App;
